INSERT IGNORE INTO `review_detail` VALUES (16,16,1,'I recommend','This maxi dress will surely be one of my favorite dresses this summer. The fit is true to size and is exactly as pictured. Looks great with flip flops and a long necklace and can def be dressed up or down depending on the occasion.','Vicky L',NULL),(17,17,1,'Cute bag. Too small.','Love it!','Nia T',NULL),(18,18,1,'Cute bag buttt to small','Blahh!!!,Smaller then I thought itd be. Why isnt it cheaper?','Nia T',NULL),(25,25,1,'Nice color','Cool green color on this mp3 player!','musicjunkie',NULL),(26,26,1,'Great Buy','I\'m digging these glasses.','Mosses',NULL),(34,34,1,'Wished it came in XXL size too','Bought a Large size, little tight for me.','John',135),(36,36,1,'Nice Fit','Great buy! I wish they had it in black too.','John',135),(37,37,1,'I\'m a big fan','I have all the albums by Shearer\r\n','Jane',136),(38,38,1,'Fits and looks Great!','I wore this for an interview. Very comfy and looks good. Price is great too.','Jane',136),(39,39,1,'Gotta Have it! And I did!','I had been saving for this beautiful pearl necklace. I\'m glad I did. ','Jane',136),(40,40,1,'Super Comfortable','Great for running around all day. Very comfortable.','Jane',136),(41,41,1,'Great buy','This is such a gorgeous dress, not only is it versatile, its comfortable and flattering for those with curves. looks great with a little shrug too.','JanaF',136),(42,42,1,'Nice','This dress is exceptionally flattering. Im a pear shape and love how it slims and flatters my curves. The color is beautiful. Im sure it will travel well. Its perfect and I highly recommend.','Lisa M',136),(43,43,1,'Nice','I love it! So comfortable. I am about 5\'5\" and it just grazes the ground if I am wearing flats. It does run a little big, so if unsure, order a size down.','Jenny E',136),(44,44,1,'Need better material','Cute dress, exacly what I was looking for, but the material is wayy too thin. This would have been perfect if it was lined or even just a heavier knit.','Erin B',136),(45,45,1,'Waiting for purchase','Beautiful dress,but too big - sent it back;you haven\'t received it? Now, I\'m worried.','Sofia S',136),(46,46,1,'Awesome love it!!!!!','SO. Flattering. This dress literally could not look better.','Sandra D',136),(47,47,1,'Like the fabric','This dress is amazing! I bought the grey in XS and the picture does not do it justice. The fit is very flattering and the seam detailing is beautiful. The material wool, but its very light and comfortable making it my favorite item in my closet for work!','Mari P',136),(48,48,1,'Love it','Love it.  It\'s like a wallet that I can\'t lose.','Laura B',136),(49,49,1,'Cool!','Perf. It fits all my books and laptop and I can swing it over my shoulder.','Ollie L',136),(50,50,1,'Good gift','my husband travels a lot for business, so this was a fantastic gift for him. Monograms a nice touch.','Cat W',136),(51,51,1,'Trendy and chic!','I bought these sunglasses after seeing some similar ones at Ray Ban. They are super cute and trendy! I get compliments all the time when wearing them!','Denise J',136),(52,52,1,'Stylish and classic','I was searching for a long time for a great pair of sunglasses and found these. They are super comfortable, stylish and simply a classic pair of chic sunglasses.','Stacy L',136),(53,53,1,'Can\'t live without them','I wanted to dislike these because I had spent so much $ on them. But then I couldn\'t live without them. Theyre simply fabulous!','Stacy L',136),(54,54,1,'Amazing','The noise cancellation feature is amazing!','Olivia M',136),(55,55,1,'Too snug','The sound was excellent but it fit a bit too snugly around my ears. I wish it were adjustable','Monica M',136),(56,56,1,'Roomy','NOT ONLY DO I CARRY MY SHOES,UMBRELLA, IPAD, ETC. BUT I SOMETIMES MY POCKETBOOK IN IT TO - SO ROOMY AND LIGHT','Sam G',135),(57,57,1,'Girlfriend loves me','Nice bag!!! I bought it for my girlfriend as a gift. She loves the color and uses everyday.','Karl S',135),(58,58,1,'fast shipping','the shipping was fast. althot it turned out to be not as big as what I thought. But it was nice and the color is a little bit dark than what I thought','Richie A',135),(59,59,1,'Overall, great','It is a great looking briefcase. I have gotten several compliments. I like the fact that it stands by itself when I put it on the floor or on the desk. The only thing that I don\'t like is that it looks big, but the inside usable space is not that big. At least it is not big enough for me. Overall, it is a great piece.','Nick H',135),(60,60,1,'quality construction','Quality leather, construction and has a professional look. ','Mark C',135),(61,61,1,'Great quality','absolutely beautiful bag. Great quality leather. Sturdy, not flimsy. Not too much organization, just enough. Big enough to fit a 15.6\" laptop, maybe even bigger. I love it.','Daniel R',135),(62,62,1,'Nice, leather for a laid back guy','I bought this as a gift for my husband, and he loves it. He is a loose tie kind of guy, but dresses up for work, so this bag works well with his style either way. The leather is excellent quality.','Criss H',135),(63,63,1,'Classy','Just the right size for travel with a laptop. It is very roomy  will hold laptop, tablet, books, magazines. Kind of classy looking too.','Logan Y',135),(64,64,1,'a little heavy','love the pcokets, the organizers and how easily it attaches to my luggage. Its a little heavy though','Darin L',135),(65,65,1,'durable','just the right wallet for guys who love simplicity. Its a very good product, durable and very useful.','Ray C',135),(66,66,1,'classics','these are a classics and always acceptable whether skiing or beaching these work a convenient carry case and lens wipers are included what more could u ask for','Ray C',135),(67,67,1,'u won\'t be disappointed','gSunglasses are excellent functionally and stylish, U wont be disappointed','Wagner B',135),(68,68,1,'love these!!!!!','Love these sunglasses! Can\'t wait to wear these more this summer','Mario N',135),(69,69,1,'cool sunnies','love love love these sunnies.....the color makes them extra special..','Joe S',135),(70,70,1,'price is good','It is very nice watch. It look just like picture. And the price is good with this watch.','Conrad M',135),(71,71,1,'photo doesn\'t do this camera justice','I just saw this watch at the Madison Island store before Christmas. This is an extremely impressive watch. If you\'re not impressed with the online picture, then I think you\'ll definitely be impressed when you see the real thing. It\'s a guaranteed attention getter ','Drew G',135),(72,72,1,'Love the zoom','Zoom is great on this camera!','Abe O',135),(74,74,1,'crisp pictuers, happy','took it with me on vacation. Good quality. Shutter speed could be improved, but still takes crisp pictures. Pretty good overall value.','Sean R',135),(75,75,1,'Son is Happy','This is a great camera for beginners..its durable. My son has been using it in his intro to photography class all  yer and its still going strong. Great buy ','William S',135),(76,76,1,'Thank you!','I just love this little device and it holds plenty of music I can travel with and share with friends. Thank you for such wonderful pricing.','Gil H',135),(77,77,1,'Good battery life','Battery life is good','John',135),(78,78,1,'Liked it, would like to have chosen color','I wasn\'t able to choose the color but other than that a good experience and very easy','John',135),(79,79,1,'Summer Blazer','Perfect Summer Blazer. I bought it for my boyfriend and he loved it!','Jessica',NULL),(80,80,1,'Great Candle Holders','Great Candle Holders','Mosses Test',NULL);
